REMASTERED NTSC DVD9

Hindi Untouched 5.1 AC3


[COLOR=Red]Special Notes:[/COLOR]
Bingo! T-Series has done it again... but this time with some Extra Craps !!!
The source DVD9 has the crapiest structure that a DVD can have ...
with first VTS structure containing T-Series labels and
second VTS structure containing movie plus all the junk, linked in the same VOB group.

Wait, that's not all!

The PGC for song Menu has been re-written as a separate PGC rather than pointing to the main PGC.
Then, as soon as the movie ends, a new PGC triggers in the same VTS structure which has almost 20+ minutes of junk!

Confused? Don't be!
DDR has made it easy for you..
Remastered DVD9 which has raw source (audio &amp; video) without any junks and proper working menu and seamless branching fixed!!!
Few titles removed; Few buttons muted as they were not needed for navigation.. Rest all clean.

Enjoy!
DDR all the way...
